?SHARED FACILITIES AGREEMENT This SHARED FACILITIES AGREEMENT (this “Agreement” or “Shared Facilities Agreement”), is made and entered into as of ____________, (the “Effective Date”), by and between Sky Ranch Solar, LLC, a Delaware limited liability company (“Sky Ranch”) and Sky Ranch Energy Storage II, LLC, a Delaware limited company (“Sky Ranch Storage”). Sky Ranch and Sky Ranch Storage are referred to herein individually as a “Party” and collectively as the “Parties.” RECITALS WHEREAS, Sky Ranch owns and operates a solar photovoltaic generating facility with approximately 190 MW aggregate nameplate capacity and a 50 MW/200 MWh battery energy storage system and related interconnection facilities located in Valencia County, New Mexico (the “Sky Ranch Project”);
WHEREAS, Sky Ranch Storage is developing and will construct, own and operate an approximately 100 MW/400 MWh battery energy storage system located in Valencia County, New Mexico (the “Sky Ranch Storage Project,” together with the Sky Ranch Project, the “Projects” and each a “Project”);
WHEREAS, each of the Projects is party to a large generator interconnection agreement (the “LGIA”) with the Public Service Company of New Mexico, Inc., as Transmission Provider (“PNM” or “Transmission Provider”) and the LGIA will allow the electric energy produced or stored by each Project to be delivered to the point of interconnection with PNM’s transmission system as set forth in the LGIA (the “Transmission System”);
WHEREAS, Sky Ranch owns certain personal property, fixtures, equipment and/or facilities described in Exhibit A attached hereto (“Shared Facilities”) are essential for the interconnection and delivery of electric energy produced and/or stored by each Project to the point of interconnection with the Transmission System set forth in the LGIA;
WHEREAS, Sky Ranch, through its predecessor in interest, and New Mexico Development Partners, LP (hereinafter “Landowner”) have entered into that certain that certain Solar Lease and Easement Agreement dated September 20, 2018, a Memorandum of which was recorded March 14, 2019 as Instrument No. 201902668 in the Office of the County Recorder for Valencia County, New Mexico relating to real property located in Valencia County, New Mexico, as more fully described therein, as amended by that certain Amendment to Solar Lease and Easement Agreement and Memorandum of Solar Lease and Easement Agreement dated October 23, 2020, which was recorded November 24, 2020 as Instrument No. 202013827 in the Office of the County Recorder for Valencia County, New Mexico, as further amended by that certain Second Amendment to Solar Lease and Easement Agreement dated October 5, 2022, which was recorded October 24, 2022 as Instrument No. 202213295 in the Office of the County Recorder for Valencia County, New Mexico, as further certain amended by that certain Third Amendment to Solar Lease and Easement Agreement dated September 21, 2023, which was recorded September 28, 2023 as Instrument No. 202311232 in the Office of the County Recorder for Valencia County, New Mexico, as further amended by that certain Fourth Amendment to Solar Lease and Easement Agreement, dated October 17, 2023, filed for record on October 17, 2023 , in Instrument No. 202311887, in the Office of the Valencia County Clerk, New Mexico, as further amended by that certain unrecorded Fifth Amendment to Solar Lease and Easement Agreement, dated December 7, 2023, as further amended by that certain Sixth Amendment to Solar Lease and Easement Agreement, dated June 27, 2024 (collectively, the “Solar Lease”);
WHEREAS, the Landowner and Sky Ranch Storage have entered into that certain Energy Storage Lease Agreement dated June 27, 2024, as evidenced by that certain Memorandum of Energy Storge Lease Agreement dated June 27, 2024 (“Storage Lease”); Landowner and Sky Ranch Storage have entered into that certain unrecorded Substation Easement dated September 12, 2024 (the “Substation Easement”); and Landowner and Sky Ranch Storage have entered into that certain unrecorded Collection Easement dated September 13, 2024 (the “Collection Easement”);
WHEREAS, Sky Ranch owns, operates and maintains the Shared Facilities, and upon the effective date, and pursuant to the terms, of a separate bill of sale, the Shared Facilities will be owned by both Parties, with Sky Ranch owning a 70.59% interest in the Shared Facilities and Sky Ranch Storage owning a 29.41% interest in the Shared Facilities as of such date;
WHEREAS, the Parties intend that through the joint ownership arrangement of the Shared Facilities, each Party will own a sufficient interest in the Shared Facilities to provide for the delivery of energy from its respective Project to the to the point of interconnection with PNM’s Transmission System (as set forth in the LGIA) in accordance with the LGIA; and
WHEREAS, in order to govern their respective rights and obligations relating to the Shared Facilities, the Parties are entering into this Agreement which will be the Parties’ expression of their intention to establish and impose mutually beneficial limitations, restrictions, covenants and conditions to provide for the proper and orderly ownership, operation and management of each Party’s respective interests in the Projects.
NOW THEREFORE, in consideration of the premises and of the mutual covenants and agreements contained herein, and for other good and valuable consideration, the receipt and sufficiency of which is hereby acknowledged, the Parties hereby agree as follows: AGREEMENT 1. TERM; EARLY TERMINATION 1.1 Term: The term of this Agreement shall commence on the Effective Date and shall continue in effect until terminated (a) by mutual agreement of the Parties, (b) pursuant to Section 1.2 of this Agreement. or (c) pursuant to Section 7.1 of this Agreement. 1.2 Early Termination: This Agreement shall automatically terminate, without further action by either Party and without further liability of any Party to any other Party, upon the date that all Parties, or their successors and assigns, shall have permanently ceased operation of the Projects for the production of electric energy. 2. GRANT OF SHARED FACILITIES RIGHTS 2.1 Grant: Recognizing each Party owns an ownership interest in the Shared Facilities sufficient to deliver its energy to the Transmission System, to the extent necessary, Sky Ranch and Sky Ranch Storage hereby grant each other during the term of this Agreement, and on the terms and subject to the conditions hereof, the non-exclusive right to access and utilize the Shared Facilities as may be reasonably necessary in connection with the ownership, operation and maintenance of each Project. 2.2 Essential Nature: Sky Ranch and Sky Ranch Storage each acknowledges that the right of each other to access and utilize the Shared Facilities is essential to the production and/or storage of electric energy by each Project and to the delivery of such energy to the Transmission System. 3. NATURE OF SHARED FACILITIES RIGHTS 3.1 Assignment or Transfer of Rights: Except as set forth in Section 9.6 hereof, neither Party shall assign or transfer any rights granted to it hereunder with regard to the Shared Facilities, or grant any permission, license, right of way or similar right with regard to the Shared Facilities without the prior written consent of the other Party. 3.2 Interference: Subject to the terms of this Agreement, in no event shall any Party be entitled to exercise its rights to access and utilize the Shared Facilities if the exercise of such rights would materially interfere with or limit the reasonable and necessary access and utilization of the Shared Facilities by any other Party. 3.3 Prior Written Consent: Except as set forth in this Agreement, neither Party shall take any action that results in the forbearance, foreclosure, termination or alteration of the respective rights or increases the obligations or responsibilities of the other Party of access to, utilization of or reliance upon the Shared Facilities without prior written consent of the other Party.
4. MAINTENANCE OF SHARED FACILITIES 4.1 Shared Facilities Manager; Allocation of Certain Costs and Expenses: (i) Sky Ranch shall be the manager of the Shared Facilities (the “Shared Facilities Manager”) with responsibility for the operations and maintenance of the Shared Facilities in accordance with the terms of the LGIA, having the responsibility for coordinating notices relating to the Shared Facilities, receiving operating instructions and ensuring responsive actions, receiving invoices and other communications from PNM, and performing all other tasks and actions contemplated under the interconnection agreement. (ii) The Shared Facilities Manager shall be responsible for the construction (to the extent needed), operation, inspection, maintenance, repair, alteration, relocation, improvement and replacement of the Shared Facilities; provided, however, that the Parties hereby agree that the costs and expenses of the operation, inspection, maintenance, repair, alteration, relocation, improvement and replacement of the Shared Facilities and of insuring the Shared Facilities shall be allocated by the Shared Facilities Manager: (a) 100% to Sky Ranch until such time as the Sky Ranch Storage Project is energized and, thereafter (b) on a 70.59% / 29.41% basis between Sky Ranch and Sky Ranch Storage, respectively. Sky Ranch Storage shall pay its respective allocation (specified above) of such costs and expenses to Sky Ranch within ten (10) days of receipt of each written notice specifying such costs and expenses. 4.2 Successor Agreement: In the event that the Projects and the Shared Facilities are no longer operated and maintained by a single entity for any reason, the Parties agree to use good faith efforts to negotiate mutually agreeable terms and execute a mutually agreeable agreement (or amendment to this Agreement) that specifies the division of responsibilities of the entities providing operation and maintenance services associated with the Shared Facilities. 4.3 Metering Protocol (a) Each Party shall arrange for metering of its Project in accordance with the LGIA. Each Party shall have a revenue meter connected to record and allocate costs for back feed and station usage by its Project. The meter readings shall be adjusted to account for transformer and transmission line losses in accordance with the Metering Protocol. (b) Any line losses occurring between the Projects and the Point of Interconnection (as defined in the LGIA) will be addressed in accordance with the Metering Protocol as set forth in Exhibit B. 5. CHANGE IN LAW 5.1 Change in Law: In the event that a change in the laws or regulations applicable to the Shared Facilities, any of the Projects, or this Agreement requires the amendment, modification or replacement of this Agreement in order to satisfy any applicable federal, state or local regulatory requirements, the Parties agree to use good faith efforts to negotiate and implement mutually agreeable terms to accomplish such amendment, modification or replacement.
6. CERTAIN COVENANTS 6.1 Authority and Operational Abilities. Each of the Parties represents, as of the Effective Date, and covenants for the term of this Agreement, that such Party has the legal authority and operational abilities to fulfill its obligations under this Agreement. 6.2 Observance of LGIA: Each Party shall exercise its rights and perform its obligations under the LGIA in a manner that is reasonable and not discriminatory against the other Party. Without limiting the generality of the foregoing, during the term of this Agreement, each Party agrees to: (i) Operate its respective Project in accordance with Good Utility Practice, Applicable Laws and Regulations and Applicable Reliability Standards, in each case as defined in the LGIA, and in a manner consistent with the terms of the LGIA. (ii) Use all commercially reasonable efforts to promptly resolve any technical issues arising in connection with the operation of its respective Project that might reasonably be expected to result in an adverse impact on another Party, and if any default occurs, to promptly cure such default in accordance with the terms of the LGIA. (iii) Not take (or refrain from taking) any action which would result in a breach of the LGIA. (iv) Provide the other Party with all reasonable information regarding the operation and condition of its respective Project required for each other Party to maintain compliance with the LGIA and this Agreement. (v) Provide to the other Party copies of all notices and instructions received by such Party that relate to the LGIA and this Agreement. 6.3 Adverse Events. (i) If an operational issue arises at one of the Projects that is reasonably expected to result in an adverse impact on the other Project or Party (an “Adverse Event”), the Party where such operational issue arises shall curtail its Project. In the event of such curtailment, the Project that has caused the Adverse Event shall not be permitted to deliver energy to the Shared Facilities, except to the extent such energy deliveries do not cause an adverse impact, until such time as the Adverse Event has been cured to the reasonable satisfaction of the other Party. (ii) If, as a direct result of an Adverse Event, the Party that did not cause such Adverse Event incurs costs, expenses, or penalties of any kind, the Project that has caused such Adverse Event shall be solely responsible for reimbursing the other Party for any such costs, expenses or penalties. In the event that both Projects are responsible for the Adverse Event, and to the extent that Sky Ranch, in its sole and absolute discretion, can accurately allocate responsibility for such Adverse Event between the Projects, each Project shall be responsible for its allocable portion of the applicable costs, expenses or penalties. If, however, it is not reasonably possible for Sky Ranch, as determined in its sole and absolute discretion, to accurately allocate such responsibility, the Projects will be liable on a pro rata basis in accordance with their ownership interest in the Shared Facilities for such costs, expenses or penalties. 6.4 Priority of Curtailment: Notwithstanding anything to the contrary in this Agreement, in the event of curtailment pursuant to the LGIA (or pursuant to applicable operating guides or applicable reliability standards and requirements), and the Transmission Provider has not ascertained which of the Projects is responsible for the event giving rise to the need to curtail, the Parties agree that they shall cause the Projects to be curtailed as follows: (i) first, and if necessary in full, if and when known, the Project (if any) the operation of which is contributing to a system emergency; and (ii) thereafter, any energy delivered from Sky Ranch Storage to the Shared Facilities, including the reservation of ancillary services capacity at the point of delivery, provided that when Sky Ranch Storage is dispatched by PNM in response to an Emergency Condition as defined in the LGIA, energy delivered from Sky Ranch Storage to the Shared Facilities shall take priority over delivery of energy delivered to the Shared Facilities from Sky Ranch. 6.5 Agreement to Cooperate. Each Party agrees to reasonably cooperate with the other Party so that, subject to the terms of this Agreement, each Project benefits from the full utilization and enjoyment of the Shared Facilities as is necessary for the efficient operation of each such Project. 6.6 No Liens. Each Party agrees not to grant any mortgages, liens, pledges, charges or security interests (collectively, “Liens”) on the Shared Facilities and to keep the Shared Facilities free and clear of all Liens other than: (i) Liens for taxes which are either not yet delinquent or are subject to a good faith contest in which adequate reserves are established in accordance with GAAP with respect to the contested item (if and to the extent GAAP requires the establishment of such reserves); (ii) defects, restrictions, irregularities, encumbrances (other than for borrowed money) and clouds on title and statutory liens that do not materially impair the value or use of the Shared Facilities for the Projects; (iii) pledges to secure statutory obligations relating to worker’s compensation and/or unemployment insurance or other social security legislation; (iv) carriers’, warehousemen’s, mechanics’, workmen’s, materialmens’, suppliers’, construction or other similar Liens arising in the ordinary course of business of the Parties or incident to the construction, operation, repair, restoration or improvement of the Shared Facilities for obligations (A) which are not yet due or (B) which are the subject of a good faith contest in which adequate reserves are established in accordance with GAAP (if and to the extent GAAP requires the establishment of such reserves); and (v) Liens arising out of judgments or awards in an amount less than $1,000,000 so long as (i) enforcement of any such Lien has been stayed and an appeal or proceeding for review is being prosecuted in good faith, and (ii) adequate reserves have been established in connection therewith in accordance with GAAP (if and to the extent GAAP requires the establishment of such reserves). 7. MATERIAL BREACH 7.1 Material Breach by any Party. In the event of any material breach of this Agreement by any Party and such Party’s failure to cure such breach within a reasonable time not to exceed thirty (30) days after receipt of written notice from any other Party describing such breach, such Party shall have the right, but not the obligation, in addition to all remedies available to it at law or in equity, to (i) cure the breach on behalf of the breaching Party, (ii) suspend the breaching Party’s access to all or any portion of the Shared Facilities owned by such non-breaching Party for so long as such default shall be continuing and remain uncured, or (iii) terminate this Agreement; provided, however, that in the event of any breach by a Party of this Agreement that may give rise to a breach by any other Party pursuant to the terms of the LGIA, such Party shall not be required to provide the breaching Party hereunder with notice and/or an opportunity to cure in order to exercise the remedy specified in clause (i) or (ii) of this sentence only; and provided, further, that the remedy specified in clause (i) may be exercised, without prejudice to any right or remedy of any Party hereunder, by any lender of such Party. If a Party (or any lender thereof) chooses to cure a breaching Party’s default, the breaching Party shall reimburse such Party (or such Party’s) upon demand for all commercially reasonable costs incurred by such Party (or such Party’s lender) in curing such breach. 8. FORCE MAJEURE 8.1 Force Majeure. In the event of an act of God, government order or restraint, war (declared or undeclared) or warlike conditions, act of terrorism, blockade, revolution, strike, lockout, civil commotion, fire, flood, storm, epidemic or any other occurrence beyond a Party’s reasonable control (each a “Force Majeure Event”), such Party shall promptly notify each other Party thereof and, so long as such condition shall persist, such Party shall not be liable for the delay in performance of, or the failure to perform, its obligations (other than obligations for payment of amounts due hereunder) under this Agreement caused directly or indirectly thereby. The claiming Party shall give each other Party notice describing the particulars of the Force Majeure Event. Within fifteen (15) days after giving notice of the Force Majeure Event, the claiming Party shall give each other Party an estimate of the Force Majeure Event’s expected duration and probable impact. The claiming Party shall continue to furnish each other Party with timely regular reports during the continuation of the Force Majeure Event. Each Party shall immediately exercise commercially reasonable efforts to mitigate or limit the impact to its obligations hereunder as a result of the Force Majeure Event.
9. MISCELLANEOUS 9.1 Relationship of Parties. The Parties do not intend to create hereby any joint venture, partnership, association or any other entity for the conduct of any business but may enter into other agreements regarding ownership of the Shared Facilities. Nothing herein shall be deemed to authorize any Party to act on behalf of any other Party. 9.2 Non-Interference. Subject to Section 3.2, each Party agrees not to interfere with the reasonable and necessary utilization of the Shared Facilities by any other Party as permitted hereunder. 9.3 Modification and Amendment. The terms of this Agreement may only be modified or amended in a writing signed by all of the Parties, which consent shall not be unreasonably withheld. 9.4 Waiver. The failure of a Party to insist upon or enforce strict performance of any of the provisions of this Agreement or to exercise any rights or remedies under this Agreement shall not be construed as a waiver or relinquishment to any extent of such Party’s right to assert or rely upon any such provisions, rights and remedies in that or any other instance; rather, the same shall be and remain in full force and effect. 9.5 Enforceability. Any provision of this Agreement which is prohibited or unenforceable in any jurisdiction shall, as to such jurisdiction, be ineffective only to the extent of such prohibition, but shall be effective to the extent of such remaining provisions hereof. 9.6 Assignment. No Party may assign any of its benefits, rights or obligations hereunder to any third party without the prior written consent of each other Party, provided, however, that any Party may collaterally assign this Agreement to any entity, or such entity’s agent, in connection with a financing or a refinancing of its respective Project. 9.7 Indemnification. Each Party shall indemnify, defend and hold each other Party, its officers, directors, shareholders, members and affiliates, harmless from any and all damages, losses, claims, actions (including but not limited to claims and actions relating to injury to or death of any person or damage to property), demands, suits, recoveries, costs and expenses, court costs, attorney fees, and all other obligations by or to third parties, arising out of or resulting from the indemnifying Party’s performance or non-performance of its obligations under this Agreement, except in cases of gross negligence or intentional wrongdoing, by the indemnified party. However, in no event shall any Party be liable under any provision of this Agreement for any losses, damages, costs or expenses for any special, indirect, incidental, consequential, or punitive damages, including but not limited to loss of profit or revenue, loss of the use of equipment, cost of capital, cost of temporary equipment or services, whether based in whole or in part in contract, in tort, including negligence, strict liability, or any other theory of liability; provided, however, that damages for which a Party may be liable to any other Party under another agreement will not be considered to be special, indirect, incidental, or consequential damages hereunder. 9.8 Choice of Law, Jurisdiction and Waiver of Jury Trial (i) This Agreement and the rights and obligations of the Parties hereunder will be governed pursuant to, and enforced, construed and interpreted in accordance with, the laws of the State of New York without regard to principles of conflicts of laws (other than Section 5-1401 of the General Obligations Law of the State of New York). Venue for resolution of any disputes under this Agreement shall be New York County, New York.
(ii) Each of the Parties irrevocably and unconditionally submits to the exclusive jurisdiction of the United States District Court for the Southern District of New York for the purposes of any suit, action or other proceeding arising out of or relating to this Agreement, the transactions contemplated hereby, any provision hereof or the breach, performance, enforcement or validity or invalidity of this Agreement or any provision hereof (and agrees not to commence any suit, action or proceeding relating thereto except in such courts). (iii) THE PARTIES HERETO EACH HEREBY KNOWINGLY, VOLUNTARILY AND INTENTIONALLY WAIVE THE RIGHT EACH MAY HAVE TO A TRIAL BY JURY WITH RESPECT TO ANY PROCEEDINGS BASED HEREON, OR ARISING OUT OF, UNDER OR IN CONNECTION WITH THIS AGREEMENT, OR ANY COURSE OF CONDUCT, COURSE OF DEALING, STATEMENTS (WHETHER ORAL OR WRITTEN) OR ACTIONS OF EITHER PARTY TO THIS AGREEMENT. THIS PROVISION IS A MATERIAL INDUCEMENT FOR THE PARTIES TO ENTER INTO THIS AGREEMENT. 9.9 Inspection of Records. Each Party shall have access to any records concerning the Shared Facilities held by any other Party upon reasonable notice and at reasonable times. 9.10 Entire Agreement. This Agreement constitutes the entire agreement of the Parties with respect to the subject matter hereof. 9.11 Section Headings. The section headings in this Agreement are for convenience of reference only and shall not modify, define, expand, or limit any of the terms or provisions hereof. 9.12 Counterparts. This Agreement may be executed in one or more counterparts, each of which when so executed shall be deemed an original, and all of which when taken together shall constitute one and the same instrument. 9.13 Specific Performance. The Parties hereto may demand specific performance of this Agreement. Each Party hereby irrevocably waives any defense based on the adequacy of a remedy at law and any other defense which might be asserted to bar the remedy of specific performance. [Signature Page Follow